People wonder what we do in an avalanche course….. well this week in a level 2 we tracked a large new load, a few storm instabilities, and changing wind slabs….. we also use terrain to reduce our risk, and manage our group with spacing and spotting……. 

What does that mean?? It means we shred pow!! Look at the snowpack, gather obs, shred more pow, and return safe, then review our day.

Another storm has set in and more of the deep days are upon us!! Stay safe everyone! 

